import React from "react";
import Card from "react-bootstrap/Card";
import Button from "react-bootstrap/Button"
import Alert from "react-bootstrap/Alert"


export default function Prize({title, pointVal, description, counter}) {
  return (
    <Card className="prize" >
      <Card.Header style={{borderBottomColor: "#66cf8c"}}> <strong>{pointVal} Pts <span style={{float: "right"}}>{counter} left</span></strong></Card.Header>
      <Card.Body style={{textAlign: "center"}}>
        <Card.Title>{title}</Card.Title>
        <Card.Text>
          {description}
        </Card.Text>
        <Button className="prize-button">Redeem</Button>
      </Card.Body>
    </Card>
  );
}
